innerComments.value:
{
       props.sublist && props.sublist.length > 0
       ? (
         <Image
           source={
             checkImage(
               Stores.UIStore.activeCollapse.show,
               Stores.UIStore.activeCollapse.type,
               props.card.header.title,
             )
           }
           resizeMode="contain"
           style={listStyles.iconRight}
         />
         )
       : (
         <Image
           source={require('../../assets/images/icons/right.png')}
           resizeMode="contain"
           style={listStyles.iconRight}
         />
         )
     }

